{
  "$schema": "http://json-schema.org/draft-07/schema#",
  "title": "Crisis Detection Output",
  "description": "Structured output from the Crisis Detection Agent containing search query, crisis categorization, and source URLs",
  "type": "object",
  "required": ["search_query", "crisis_detected", "sources", "processed_at"],
  "properties": {
    "search_query": {
      "type": "string",
      "description": "The search query used or recommended for finding information about this crisis",
      "examples": ["Turkey Syria earthquake February 2023", "Ukraine war latest casualties", "Cyclone Michaung Chennai"]
    },
    "crisis_detected": {
      "type": "boolean",
      "description": "Whether a confirmed/likely crisis was detected in the content"
    },
    "crisis_data": {
      "type": ["object", "null"],
      "description": "Crisis details if detected, null otherwise",
      "properties": {
        "crisis_id": {
          "type": "string",
          "pattern": "^[A-Z]+-[A-Z]{2,3}-\\d{8}$",
          "description": "Unique ID format: TYPE-COUNTRYCODE-YYYYMMDD",
          "examples": ["EARTHQUAKE-TUR-20230206", "WAR-UKR-20220224", "CYCLONE-IND-20231204"]
        },
        "title": {
          "type": "string",
          "description": "Brief descriptive title",
          "examples": ["2023 Turkey-Syria Earthquake", "Russia-Ukraine War", "Cyclone Michaung"]
        },
        "category": {
          "type": "object",
          "required": ["primary", "sub_category"],
          "properties": {
            "primary": {
              "type": "string",
              "enum": [
                "Armed Conflict",
                "Natural Disaster",
                "Public Health",
                "Industrial/Technological",
                "Humanitarian",
                "Economic",
                "Political"
              ]
            },
            "sub_category": {
              "type": "string",
              "enum": [
                "War", "Civil War", "Terrorism", "Military Coup", "Border Clash", "Insurgency",
                "Earthquake", "Flood", "Cyclone/Hurricane/Typhoon", "Tsunami", "Wildfire", "Drought", "Volcanic Eruption", "Landslide", "Tornado", "Heatwave",
                "Pandemic", "Epidemic", "Famine", "Contamination", "Disease Outbreak",
                "Industrial Accident", "Infrastructure Collapse", "Transportation Disaster", "Nuclear Incident", "Cyberattack", "Dam Failure",
                "Refugee Crisis", "Genocide", "Ethnic Cleansing", "Mass Displacement", "Human Rights Crisis",
                "Financial Crisis", "Currency Collapse", "Supply Chain Collapse", "Hyperinflation",
                "Civil Unrest", "Government Collapse", "Election Crisis", "Mass Protests", "Revolution"
              ]
            }
          }
        },
        "status": {
          "type": "string",
          "enum": ["CONFIRMED", "LIKELY"],
          "description": "Verification status - only CONFIRMED or LIKELY events are included"
        },
        "severity": {
          "type": "string",
          "enum": ["CRITICAL", "HIGH", "MEDIUM", "LOW"],
          "description": "Impact severity level"
        },
        "location": {
          "type": "object",
          "required": ["country"],
          "properties": {
            "country": {
              "type": "string",
              "description": "Primary country affected"
            },
            "country_code": {
              "type": "string",
              "pattern": "^[A-Z]{2,3}$",
              "description": "ISO country code"
            },
            "region": {
              "type": "string",
              "description": "Region or state within country"
            },
            "city": {
              "type": "string",
              "description": "Specific city if applicable"
            },
            "coordinates": {
              "type": "object",
              "properties": {
                "latitude": {"type": "number", "minimum": -90, "maximum": 90},
                "longitude": {"type": "number", "minimum": -180, "maximum": 180}
              }
            },
            "affected_areas": {
              "type": "array",
              "items": {"type": "string"},
              "description": "List of specific affected areas"
            }
          }
        },
        "timeline": {
          "type": "object",
          "properties": {
            "start_date": {
              "type": "string",
              "format": "date",
              "description": "Crisis start date (YYYY-MM-DD)"
            },
            "end_date": {
              "type": ["string", "null"],
              "format": "date",
              "description": "Crisis end date if resolved, null if ongoing"
            },
            "current_phase": {
              "type": "string",
              "enum": ["Emerging", "Escalating", "Peak", "Stabilizing", "Declining", "Resolved"]
            },
            "duration_days": {
              "type": "integer",
              "description": "Number of days since crisis started"
            }
          }
        },
        "impact": {
          "type": "object",
          "properties": {
            "casualties": {
              "type": "object",
              "properties": {
                "deaths_confirmed": {"type": "integer", "minimum": 0},
                "deaths_estimated": {"type": "integer", "minimum": 0},
                "injured": {"type": "integer", "minimum": 0},
                "missing": {"type": "integer", "minimum": 0}
              }
            },
            "displacement": {
              "type": "object",
              "properties": {
                "internally_displaced": {"type": "integer", "minimum": 0},
                "refugees": {"type": "integer", "minimum": 0},
                "evacuated": {"type": "integer", "minimum": 0}
              }
            },
            "affected_population": {
              "type": "integer",
              "description": "Total people affected"
            },
            "infrastructure_damage": {
              "type": "string"
            },
            "economic_impact_usd": {
              "type": "string",
              "description": "Estimated economic damage"
            }
          }
        },
        "response": {
          "type": "object",
          "properties": {
            "emergency_declared": {"type": "boolean"},
            "government_response": {"type": "string"},
            "international_response": {"type": "string"},
            "humanitarian_organizations": {
              "type": "array",
              "items": {"type": "string"}
            }
          }
        },
        "keywords": {
          "type": "array",
          "items": {"type": "string"},
          "description": "Keywords for monitoring this crisis"
        }
      }
    },
    "sources": {
      "type": "array",
      "description": "All source URLs with metadata",
      "items": {
        "type": "object",
        "required": ["url", "source_name", "credibility"],
        "properties": {
          "url": {
            "type": "string",
            "format": "uri"
          },
          "title": {
            "type": "string"
          },
          "source_name": {
            "type": "string",
            "examples": ["Reuters", "BBC", "UN OCHA", "WHO", "AP News"]
          },
          "source_type": {
            "type": "string",
            "enum": [
              "Official Government",
              "UN Agency",
              "Major News Agency",
              "Local News",
              "NGO",
              "Academic/Research",
              "Other"
            ]
          },
          "published_date": {
            "type": "string",
            "format": "date-time"
          },
          "credibility": {
            "type": "string",
            "enum": ["HIGH", "MEDIUM", "LOW"]
          },
          "key_facts_from_source": {
            "type": "array",
            "items": {"type": "string"},
            "description": "Key verified facts extracted from this source"
          }
        }
      }
    },
    "processed_at": {
      "type": "string",
      "format": "date-time",
      "description": "Timestamp when this analysis was performed"
    },
    "confidence_score": {
      "type": "number",
      "minimum": 0,
      "maximum": 1,
      "description": "Overall confidence in the crisis detection and categorization"
    },
    "notes": {
      "type": "string",
      "description": "Additional notes or caveats about the analysis"
    }
  }
}
